import { Navigation } from "./navigation";
import { Footer } from "./footer";
import JsonData from "../data/data.json";
import { ToggleButtonGroup, ToggleButton } from "react-bootstrap";
import { useState } from "react";

//add on if necessary - past years
let years = [2020, 2019];

export const AlumniPage = (props) => {


  const [year, setYear] = useState(2021);

  const YearButton = (props) => {
    return (
      <label className="btn btn-primary" onFocus={(e) => {setYear(e.target.innerText)}}>
        <input
          type="radio"
          name={props.year}
          value="android"
          autoComplete="off"

          />{" "}
        {props.year}
      </label>
    )
  };

  function setY(e) {
    console.log(e)
  }

  return (
    <div>
    <div id='alumni' className='text-center'>
      <Navigation />
      <div className='col-md-8 col-md-offset-2 section-title'>
          <h2>Alumni</h2>
          <p>
            Check out our alumni from past years!
          </p>
      </div>
        <div className="container">
          <div className="btn-group btn-group-toggle" data-toggle="buttons">
            <label className="btn btn-primary active" onFocus={(e) => {setYear(e.target.innerText)}}>
              <input
                type="radio"
                name="2021"
                value="web"
                autoComplete="off"

              />{" "}
              2021
            </label>
            {
              years.map(num => (
                <YearButton year={num}/>
              ))
            }
          </div>

          <div id='row' className="cardrow">
              {JsonData.Team
              ? JsonData.Team.map((d, i) => (
                <div className='card col-xs-4'>
                  <img src={d.img} />
                  <div className='caption'>
                      <h4>{d.name}</h4>
                  <div class="social-links">
                    {d.linkedin ? <a href={d.linkedin} className="linkedin"><i class="fa fa-linkedin"></i></a> : ""}
                    {d.instagram ? <a href={d.instagram} className="insta"><i class="fa fa-instagram"></i></a> : ""}
                    {d.twitter ? <a href={d.twitter} className="twitter"><i class="fa fa-twitter"></i></a> : ""}
                  </div>
                  </div>
                </div>
                ))
            : 'hey'}
          </div>
        </div>



    </div>
    <Footer data={JsonData.Contact}/>
    </div>
  )
}
